import ColumnChart from "../Launch/Charts/ColumnChart";
import LineChart from "../Launch/Charts/LineChart";
import PieChart from "../Launch/Charts/PieChart";

function CandidateProfile() {
    return <>


        <div style={{ display: "flex", flexDirection: "row", width: "100%" }}>
            <div style={{ marginLeft: "8%", marginRight: "2%" }}><ColumnChart></ColumnChart></div>
            <div style={{ marginLeft: "10%" }}><PieChart></PieChart></div>
            <div style={{ marginLeft: "10%" }}><LineChart></LineChart></div>

        </div>


        <br></br>
        <br></br>

        <div style={{ display: "flex", flexDirection: "row", width: "100%" }}>
            <div style={{ marginLeft: "8%", marginRight: "2%" }}><ColumnChart></ColumnChart></div>
            <div style={{ marginLeft: "10%" }}><PieChart></PieChart></div>
            <div style={{ marginLeft: "10%" }}><LineChart></LineChart></div>

        </div>


    </>
}

export default CandidateProfile;
